        <div id="u576_text" class="text ">
          <p><span>&nbsp;&nbsp;&nbsp; 三苏祠位于四川省眉山市城西，是我国著名文学家苏洵、苏轼、苏辙的故居。原为五亩庭院，元代改宅为祠，明末毁于兵火，清康熙四年（1665）在原址摹拟重建。经历代增修扩建，现占地86亩。三苏祠既保持了苏氏故居的风貌，又体现了祠园建筑的古朴幽深。肃穆中有疏朗之气，典雅中而洋洋大观。</span></p>
